Homes by the Sea: Series 1
Charlie Luxton visits some of Britain's best homes by the sea to find out what makes the perfect coastal property


1)  South West Wales 
Charlie Luxton visits some of Britain's best seaside properties and designs his own fantasy home in each location, taking inspiration from local architecture and scenery. He begins on the Pembrokeshire coast, where he views a space-age home built into the cliffs of St Brides Bay and advises a couple undertaking a huge renovation project overlooking Fishguard Harbour. He then heads to Newport, sailing up the River Nevern to explore the secrets of a remarkable waterside property, before visiting an ancient castle that doubles up as a cosy period cottage.

2)  South Devon 
Architectural designer Charlie Luxton travels to the south Devon coast to investigate why it has become the most sought-after place in Britain to have a seaside property. He begins at a clifftop home near Brixham, before visiting a fisherman's cottage in Lympstone. He then explores a house inspired by the modernist design of the 1960s in Kingswear, and also checks out a 1930s villa overlooking Torbay.

3)  Norfolk 
Charlie Luxton travels to Norfolk to explore more coastal properties, beginning at Blakeney where a couple take him on a tour of their former granary home, located on the quayside with views across the salt marshes. He also visits a lighthouse in Winterton-on-Sea, a beach hut in Sheringham and a 200-year-old windmill in Cley next the Sea.

4)  Isle of Skye 
Charlie Luxton visits the Isle of Skye in the Inner Hebrides to explore how some of the island's abandoned buildings are being brought back to life by an influx of newcomers. He explores a traditional Skye longhouse, which blends Scottish simplicity and Scandinavian chic, before viewing a white property and a contemporary farm house. He also looks inside the ancestral home of Lord and Lady Macdonald, and an eco-home decorated with flotsam and jetsam.

5)  Kent and Sussex 
Charlie explores properties on the Kent and Sussex coasts, beginning at a home inspired by the seafront properties of Australia in Camber Sands. He also visits a home made from a converted railway carriage in Dungeness, a Martello tower in Dymchurch, and two properties in the town of Brighton.

6)  Northumberland 
Charlie Luxton explores coastal properties in Northumberland, beginning in the fishing village of Craster, where he visits Craster Tower - an 18th-century Georgian mansion - before travelling to Whitley Bay to a seafront semi-detached property. He also explores a modern-build overlooking Druridge Bay and a transformed farmstead near Bamburgh.

